import React from 'react';
import '../css/style.css';
import 'bootstrap/dist/css/bootstrap.css';

const Topbar = () => {
    return (
        <div className="container-fluid bg-dark p-0 wow fadeIn" data-wow-delay="0.1s">
            <div className="row gx-0 d-none d-lg-flex">
                <div className="col-lg-7 px-5 text-start">
                    <div className="h-100 d-inline-flex align-items-center py-3 me-3">
                        <a className="text-body px-2" href="tel:+918079839919">
                            <i className="fa fa-phone-alt text-secondry me-2"></i>+91 8079839919
                        </a>
                        <a className="text-body px-2" href="mailto:info@metafia.in">
                            <i className="fa fa-envelope-open text-secondary me-2"></i>info@metafia.in
                        </a>
                    </div>
                </div>
                <div className="col-lg-5 px-5 text-end">
                    <div className="h-100 d-inline-flex align-items-center py-3 me-2">
                        {/* Replace empty href with a valid URL or change to a button */}
                        <a className="text-body px-2" href="/terms">Terms</a>
                        <a className="text-body px-2" href="/privacy">Privacy</a>
                    </div>
                    <div className="h-100 d-inline-flex align-items-center">
                        <a className="btn btn-sm-square btn-outline-body me-1" href="https://wa.me/+918079839919">
                            <i className="fab fa-whatsapp"></i>
                        </a>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Topbar;
